import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="bitcoun.png" className="App-logo" alt="logo" />
        <p>
          Kurs BitCoin
        </p>
      </header>
    </div>
  );
}

export default App;
